import React from "react";
import InsideCornerBottomLeftImage from './res/insidecornerbottomleft.jpg';
import './Tile.css'

const InsideCornerBottomLeft = () => {
    return (
        <img className="myTileImg" src={InsideCornerBottomLeftImage}/>
    )
};

export default InsideCornerBottomLeft;
